        "weCombineHardwareAndSoftwareMethods": MessageLookupByLibrary.simpleMessage(
            "தரவு அடிப்படையிலான சீரற்றதை உறுதி செய்ய நாங்கள் கடவுச்சொல் அல்காரிதங்களை உள்ளடக்கிய நரம்பியல் மற்றும் மென்பொருள் முறைகளை இணைக்கிறோம். கணினிகளின் மேற்பரப்புகளை நாங்கள் அடிக்கடி சோதிக்கிறோம்."),
        "weDoNotSellOrRentYourPersonalInformationToThirdParties":
            MessageLookupByLibrary.simpleMessage(
                "நாங்கள் உங்கள் தனிப்பட்ட தகவல்களை மூன்றாம் தரப்புகளுக்கு விற்பனை அல்லது வாடகை போட மாட்டோம். எனினும், நாங்கள் எங்கள் சேவைகளை இயக்க மற்றும் மேம்படுத்த உதவ உதவிக்கு நம்பகமான பங்குதாரர்களுடன் உங்கள் தரவுகளைப் பகிரலாம். இந்த பங்குதாரர்கள் கவனமாக தேர்ந்தெடுக்கப்பட்டவை மற்றும் உங்கள் தகவல்களை பாதுகாப்பாகவும் ரகசியமாகவும் வைத்திருக்க எங்கள் கடுமையான தனியுரிமை நிலைமைகளுக்கு இணங்க நடவடிக்கை எடுக்கவேண்டும்."),
        "weGatherARangeOfInformationToEnhanceYourExperience":
            MessageLookupByLibrary.simpleMessage(
                "எங்கள் இணையதளம் மற்றும் சேவைகளில் உங்கள் அனுபவத்தை மேம்படுத்த பல்வேறு தகவல்களை சேகரிக்கிறோம். இதில், உங்கள் பெயர், மின்னஞ்சல் முகவரி மற்றும் பிற தொடர்பு தகவல்கள் போன்ற தனிப்பட்ட விவரங்கள் தன்னார்வமாக வழங்கப்படுவதைக் 포함மாகும். மேலும், குக்கீஸ், லாக் கோப்புகள் மற்றும் பிற கண்காணிப்பு தொழில்நுட்பங்கள் மூலம் உங்கள் IP முகவரி, உலாவி வகை மற்றும் செயலாக்கக் கணினி முறை போன்ற பயன்பாட்டு தரவுகளை சேகரிக்கிறோம். இந்த தொழில்நுட்பங்கள் எவ்வாறு நாங்கள் உங்கள் இணையதளத்தைப் பயன்படுத்துகிறீர்கள் என்பதைக் புரிந்து கொள்ள உதவுகிறது, எங்கள் சேவைகளை மேம்படுத்துவதற்கும், மேலும் தனிப்பட்ட அனுபவத்தை வழங்குவதற்கும் உதவுகிறது. சேகரிக்கப்பட்ட அனைத்து தரவுகளும் கடுமையான ரகசியத்தன்மை மற்றும் பாதுகாப்பு நடவடிக்கைகளுடன் கையாளப்படும் என்பதை உறுதிப்படுத்துகிறோம்."),
